// src/App.js (Ejemplo)
import React from 'react';
import './App.css'; // Si tienes un CSS global para App
import Header from './components/Header'; // Asumiendo que tienes un Header
import Productos from './components/Productos'; // Tu componente de productos existente
import Ubicacion from './components/Ubicacion'; // ¡El nuevo componente!
import Footer from './components/Footer'; // Asumiendo que tienes un Footer

function App() {
  return (
    <div className="App">
      <Header />
      {/* Otras secciones de tu aplicación */}
      <Productos />
      <Ubicacion /> {/* Añade el componente de Ubicación aquí */}
      <Footer />
    </div>
  );
}

export default App;
